def calc(s, d):
	if s == d: return 0;
	ans = 0
	if s % 2 != 0:
		ans += 1
		s += 1
	if d % 2 != 0:
		ans += 1
		d -= 1
	return ans + calc(s>>1, d>>1);

n = int(input())
for i in range(n):
	s, d = map(int, input().split())
	print(calc(s, d))

